import React from "react";

function Filter({ filterData }) {
    return(
        <div className='flex gap-4 justify-center text-white my-2'>
            {filterData?.map((data) => (
                <button key={data.id} type="button" className="bg-indigo-900 p-2 rounded-sm border-white hover:border-2 duration-300">{data.title}</button>
            ))}
        </div> 
    )
}
export default Filter;
